import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Find and click the "Your Profile" link. We'll use the first one we find.
    const profileLink = page.getByRole('link', { name: 'Your Profile', exact: true }).first();
    await profileLink.waitFor({ state: 'visible', timeout: 5000 });
    await profileLink.click();

    // Wait for the profile page content to load, specifically Jun's name
    await page.waitForSelector('h2:has-text("Jun Kim")', { timeout: 5000 });

    // Take a screenshot of the profile page
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_page.png'));

    // Extract data to verify the profile loaded correctly
    const profileName = await page.locator('h2:has-text("Jun Kim")').textContent();
    const username = await page.locator('p.username:has-text("@jun")').textContent();

    return {
      success: true,
      action: "Navigated to Jun's Profile page by clicking the 'Your Profile' link.",
      extractedData: {
        profileName: profileName,
        username: username
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // Take a screenshot on error
    try {
      await page.screenshot({ path: path.join(screenshotsDir, 'error.png') });
    } catch (e) {
      // Ignore if screenshot fails
    }
    return {
      success: false,
      action: "Failed to navigate to Jun's Profile",
      extractedData: {},
      screenshots: [path.join(screenshotsDir, 'error.png')],
      error: error.message
    };
  }
}
